import "./Cat.scss";
import { Link } from "react-router-dom";

function Cat({ name, image, age }) {
  return (
    <div className="cat">
      <img className="cat__image" src={image} />
      <div className="cat__name">
        <h2 className="cat__label">{name}</h2>
        <h3 className="cat__age">{age}</h3>
      </div>
    </div>
  );
}
export default Cat;
